import React from 'react'
import { NavLink } from "react-router-dom"


const Navbar = () => {
    return (
        <div>
            <NavLink to="/" exact activeStyle={{ background: 'red', color: 'white' }} >Home</NavLink>

            <NavLink to="/about" exact activeStyle={{ background: 'green', color: 'white' }}>About Us</NavLink>

            <NavLink to="/service" exact activeStyle={{ background: 'blue', color: 'white' }}>Service</NavLink>

            <NavLink to="/user" exact activeStyle={{ background: 'skyblue', color: 'white' }}>user</NavLink>
        </div>
    )
}

export default Navbar
